import React from 'react';
import Webcam from 'react-webcam';

interface IState {
    startDate: Date;
    endDate: Date;
    roomType: string;
    previewImg?: any;
    success: boolean; 
    url: string;
    photoInput: boolean;
    test: string;
    tries: number;
}

export default class Lmao extends React.Component<{}, IState> {
    constructor(props: {}) {
        super(props);
        this.state = {
            startDate: new Date(),
            endDate: new Date(),
            roomType: "", 
            success: false, 
            url: "", 
            photoInput: false,
            test: "", 
            previewImg: null,
            tries: 0
        }
    }


    public render(): JSX.Element {
        return <div>
            <h1>lkjsfdlkj</h1>
            <Webcam
            height={360}
            width={1280}
            screenshotFormat="image/jpeg"
            audio={false}

            />
            <div>
            <img src={this.state.previewImg} />
            </div>
        </div>
    }
}
